"""# Preparation of the Dataset 
Now begins the preparation phase for the classification algorithm, so that we can run the selected classification algorithm we will need to prepare some functions that will help later.

In order for us to run the algorithm of RandomForest we need to extract features from the images in the selected dataset.

In order to extract features we will use 3 auxiliary methods which we will detail and explain.

Feature Extraction algorithms can be classified into three categories.

It is necessary to find all possible feature subsets that can be formed from the initial set of data,Global features, which are usually topological or statistical.

The feature extraction is an important engineering process, for it is the main information about the raw data, that the algorithm identifies.

Selecting the most meaningful features is a crucial step in the process of classification problems because:

Let’s use Global Features for our task. To do so, we have inbuilt functions under OpenCV, mahotas and sklearn libraries.

Then, We will use the functions found in OpenCV to run them on the dataset.
We will use for example the function HuMoment which returns the moment of the image pixels' intensities . The resault is an array.
And than this array is then flattened to get the feature vector for the Hu moments.

# Global Feature Extraction

Our three global feature descriptors are:

* Color Histogram that quantifies color of the art images.

* Hu Moments that quantifies shape of the art images.

* Haralick Texture that quantifies texture of the art images.

As we know images are matrices, we need an efficient way to store our feature vectors locally. Our script takes one image at a time, extract three global features, concatenates the three global features into a single global feature and saves it along with its label in a HDF5 file format.

Insted of using HDF5 file-format, we could use “.csv” file-format to store the features.But, as we will be working with large amounts of data in future, we will work  with HDF5 format.

### 1. Hu Moments

To extract Hu Moments features from the image, we use  ```cv2.HuMoments()``` function provided by OpenCV.

The argument to this function is the moments of the image ```cv2.moments()```flatenned. It means we compute the moments of the image and convert it to a vector using ```flatten()```.

Before doing that, we convert our color image into a grayscale image as moments expect images to be grayscale.
"""

def fd_hu_moments(image):
    image = cv2.cvtColor(image, cv2.COLOR_BGR2GRAY)
    feature = cv2.HuMoments(cv2.moments(image)).flatten()
    return feature

