"""## 3. Color Histogram

To extract Color Histogram features from the image, we use ```cv2.calcHist()``` function provided by OpenCV.

The arguments it expects are the image, channels, mask, histSize (bins) and ranges for each channel [typically 0-256).

We then normalize the histogram using ```normalize()``` function of OpenCV and return a flattened version of this normalized matrix using ```flatten()```.
"""

def fd_histogram(image, mask=None):
    image = cv2.cvtColor(image, cv2.COLOR_BGR2HSV)
    hist  = cv2.calcHist([image],[0,1,2],None,[bins,bins,bins], [0, 256, 0, 256, 0, 256])
    cv2.normalize(hist,hist)
    return hist.flatten()

"""###Extract Features 
Once you have all calculates features for all images in your dataset, concatenate all the features obtained. This process of concatenation reduces the correlation between features thus making linear classification more efficient

We have now come to the important method that this method will extract the features from the images.
This methode will use the 3 methode taht we talk about above(fd_hu_moments, fd_haralick , fd_histogram).

Feature extraction is a process of dimensionality reduction by which an initial set of raw data is reduced to more manageable groups for processing. A characteristic of these large data sets is a large number of variables that require a lot of computing resources to process. Feature extraction is the name for methods that select and /or combine variables into features, effectively reducing the amount of data that must be processed, while still accurately and completely describing the original data set.

In our opinion this is a very importent part before to start training a model of RandomForest.

with this mtehode we will get three lists of features, labels and names of our images.
"""

def feature_extraction(labels, path):
    global_features = []
    labels = []
    Images = []
    i, j = 0, 0 
    k = 0

    fixed_size  = tuple((500,500))
    for name in labels_name:
        dir = os.path.join(path, name)
        current_label = name
        k = 1
        for file in os.listdir(dir):
            file = dir + "/" + os.fsdecode(file)
            image = cv2.imread(file) 
        
            if image is not None:
                image = cv2.resize(image,fixed_size)
                fv_hu_moments = fd_hu_moments(image)
                fv_haralick   = fd_haralick(image)
                fv_histogram  = fd_histogram(image)
            
                Images.append(image)
            global_feature = np.hstack([fv_histogram, fv_haralick, fv_hu_moments])
            labels.append(current_label)
            global_features.append(global_feature)
            i += 1
            k += 1
        print("Current processed folder: {}".format(current_label))
        j += 1
    print("Completed Global Feature Extraction...")
    return global_features, labels, Images

